import React, { useEffect,useContext, useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { userContext } from '../utils/ContextProvider';

const SavedDrafts = ({open}) => {

  const navigate = useNavigate();
  const [select,setSelect] = useState(null);
  const drafts = ["data:image/png;base64," , "data:image/png;base64,"]

  useEffect(() =>{
    if(open){document.body.style.overflow = "hidden"}
    else {document.body.style.overflow = "auto"}
  
    return ()=>{document.body.style.overflow = "auto"}
  },[open])

  const handleOpen = async(img)=>{
    if(!img) return;
    await navigate("/edit-image", { state: { newImage: img}});
  }

  return (
    <div className='fixed inset-0 z-100 flex justify-center items-center bg-black/50'>
      
      <div className='w-[90%] max-w-xl h-[600px] bg-white rounded-xl py-4 p-8 flex flex-col justify-center gap-4 text-md md:text-xl shadow-xl'>
        <p className='md:text-3xl font-semibold text-gray-600 font-ubuntu'>Saved Drafts</p>
        <div className='border border-gray-400 rounded-md h-[400px] flex flex-col items-center gap-5 overflow-y-auto p-5'>
          <ul className='grid grid-cols-2 gap-5'>
            {drafts.map((image,ind)=>(
              <li key={ind} onClick={()=>setSelect(pre=>pre===ind ? null : ind)} className={`border cursor-pointer border-gray-400 ${select === ind ? "ring-2" : ""} ring-purple-500 bg-gray-200 p-2 rounded-md`}>
                <img src={image} alt={`draft ${ind+1}`} className='h-[200px] w-[300px]' /></li>
            ))}
          </ul>
        </div>
        <div className='flex gap-3 justify-end text-lg'>
            <button className='border-2 border-gray-600 py-2 px-3 rounded-full cursor-pointer' onClick={()=>open(false)}>Cancel</button>
            <button className={`rounded-full ${select==null ? "bg-gray-400" : "bg-purple-500"} text-white px-4 py-2 cursor-pointer`} 
            disabled={select === null} onClick={()=>{handleOpen(drafts[select])}}>Open</button>
        </div>
      </div>
    
    </div>
  )
}

export default SavedDrafts
